cy.get('@purpose')
    .find('[data-testid="uco-c-brand-purpose-items"] article')
    .each(function ($article, index) {
    if (index <= 1) {
        // h2 title
        cy.wrap($article).find('h2').should('exist').should('not.be.null');
        // Body text
        cy.wrap($article)
            .find('[data-testid="uol-c-card-body"] p')
            .first()
            .should('exist')
            .should('not.be.null');
        // Video hyperlink
        cy.wrap($article).find('a[data-testid="uol-c-button"]').should('have.attr', 'href');
        // Download link
        cy.wrap($article).find('a[data-testid="uol-c-link"]').should('have.attr', 'href');
    }
});
